import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { login } from '../services/api';
import './Auth.css'

function Login() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const response = await login(formData);
      localStorage.setItem('token', response.data.token);
      navigate('/dashboard');
    } catch (err) {
      setError(err.response?.data?.error || 'Login failed');
      setLoading(false);
    }
  };

  return (
    <div className="auth-container">
      {/* Left Side - Form */}
      <div className="auth-left">
        <div className="auth-form-wrapper">
          <h1 className="auth-title">Welcome back!</h1>
          <p className="auth-subtitle">
            Simplify your workflow and boost your productivity with CodeFolio. Get started for free.
          </p>

          {error && <div className="auth-error">{error}</div>}

          <form onSubmit={handleSubmit} className="auth-form">
            <div className="form-group">
              <input
                type="email"
                name="email"
                placeholder="Email"
                value={formData.email}
                onChange={handleChange}
                required
                className="auth-input"
              />
            </div>

            <div className="form-group">
              <input
                type="password"
                name="password"
                placeholder="Password"
                value={formData.password}
                onChange={handleChange}
                required
                className="auth-input"
              />
            </div>

            <div className="forgot-password">
              <a href="#forgot">Forgot Password?</a>
            </div>

            <button type="submit" className="auth-button" disabled={loading}>
              {loading ? 'Logging in...' : 'Login'}
            </button>
          </form>

          <div className="auth-divider">
            <span>or continue with</span>
          </div>

          <div className="social-login">
            <button 
  className="social-btn google" 
  type="button"
  onClick={() => navigate('/google-login-demo')}
>
  <span>G</span>
</button>
            <button className="social-btn apple" type="button">
              <span>üçé</span>
            </button>
            <button className="social-btn facebook" type="button">
              <span>f</span>
            </button>
          </div>

          <div className="auth-footer">
            Not a member? <Link to="/register">Register now</Link>
          </div>
        </div>
      </div>

      {/* Right Side - Illustration */}
      <div className="auth-right">
        <div className="illustration-wrapper">
          <div className="illustration-content">
            <img 
              src="https://illustrations.popsy.co/amber/meditation.svg" 
              alt="Meditation" 
              className="meditation-image"
            />
            <h2>Make your work easier and organized</h2>
            <p>with <strong>CodeFolio</strong></p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Login;
